import React from 'react';
import { Link } from 'react-router-dom';

const Home = () => {
  return (
    <div>
      <h1 class="heading" >The Capital Bridge </h1>
      <p>Choose your role:</p>
      <Link to="/RegistrationI"> Register
      </Link>
      <Link to="/RegistrationI">
        <button>Register as a Capital Source</button>
      </Link>
    </div>
  );
};

export default Home;
